import React from "react";

const SearchBox = ({ value, onChange }) => {
  return (
    <form id="demo-2">
      <input
        type="search"
        name="query"
        placeholder="Search"
        value={value}
        onChange={(e) => onChange(e.currentTarget.value)}
      />
    </form>
  );
};

export default SearchBox;
